import React from 'react'
import './CardContainer.css';
import Card from './Card'
function CardContainer()
{
 return(
    <div className="Card-Container">
        <Card
        imgSrc="https://picsum.photos/200/300"
        />
        <Card/>
        <Card/>
        <Card/>
    </div>
 );   
}
export default CardContainer;
